        private static void Solve(int exampleNum, string input)
        {
            int result = LongestSubstringSolution.LengthOfLongestSubstring(input);

            Console.WriteLine($"Example {exampleNum}):");
            Console.WriteLine($"  Input: s = \"{input}\"");
            Console.WriteLine($"  Output: longest substring = {result}");
            Console.WriteLine();
        }
