    internal class LongestSubstringSolution
    {
        public static int LengthOfLongestSubstring(string s)
        {
            if (s.Length <= 1)
            {
                return s.Length;
            }

            List<string> substrings = [];

            char[] inputChars = s.ToCharArray();

            for (int i = s.Length; i > 1; i--)
            {

                int start = 0;
                while (start <= inputChars.Length - i)
                {
                    substrings.Add(s.Substring(start, i));
                    start++;
                }

                // possible improvement: hash instead of linq
                if (substrings.Any(s => s.Distinct().Count() == i))
                {
                    return i;
                }
                else
                {
                    substrings.Clear();
                }
            }

            return 1;
        }

        public static int LengthOfLongestSubstring_orig(string s)
        {
            List<string> substrings = [];

            char[] inputChars = s.ToCharArray();

            string currentSub = string.Empty;
            List<char> used = [];

            int index = 0;
            while (index < inputChars.Length)
            {
                char currentChar = inputChars[index];

                if (used.Contains(currentChar))
                {
                    substrings.Add(currentSub);
                    currentSub = string.Empty;
                    used = [];

                    if (currentChar != inputChars[index - 1])
                    {
                        index--;
                    }
                    continue;
                }

                used.Add(currentChar);
                currentSub += currentChar;
                index++;
            }

            substrings.Add(currentSub);

            return substrings.Aggregate("", (max, curr) => max.Length > curr.Length ? max : curr).Length;
        }
    }

